import React from 'react'

const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  const Header = (props) => {
    console.log(props)
    return <h1>{props.course}</h1>
  }

  const Content = (props) => {
    return (
      <div>
        <Part parts={parts}/>
        <Part parts={parts}/>
        <Part parts={parts}/>
      </div>
    )
  }

  const Part = (props) => {
    return (
      <div>
        <p>{props.parts}</p>
      </div>
    )
  }


  const Total = (props) => {
    console.log(props)
    return <p>Number of exercices</p>
  }

  return (
      <div>
        <Header course={course}/>
        <Content parts={parts}/>
        <Total parts={parts}/>
      </div>
  )
}

export default App
